import Task from './Task'

const TaskList = ({ tasks = [], onEditTask, onDeleteTask }) => {


  return (
    <ul class="todo-list">
      {tasks.map(({ id, description, completed, created }) => {
        return (
          <Task
            description={description}
            completed={completed}
            created={created}
            onEdit={() => {
              onEditTask(id)
            }}
          />
        )
      })}
    </ul>
  )
}

export default TaskList;
